var base_64_image_pdf = "data:image/png;base64,";
var base_64_image_xls = "data:image/png;base64,";
var base_64_image_xlsx = "data:image/png;base64,";
var base_64_image_ms_word = "data:image/png;base64,";
var base_64_image_txt = "data:image/png;base64,";

